.post_content DIV:last-child,BLOCKQUOTE{border-color:rgba(155,40,222,1)!important}


pre,pre a,pre SPAN,.quote_source pre,div pre,pre SPAN,pre a,CODE,pre small{background:rgba(239,214,255,.8)!important;color:rgba(155,40,222,1)!important;font:bold .9em "arial",consolas,courier!important;white-space:pre-wrap!important;white-space:-moz-pre-wrap!important;white-space:-pre-wrap!important;white-space:-o-pre-wrap!important;word-wrap:break-word!important}


.return_to_top_icon{background:rgba(255,255,255,0)!important;
