margin-left:19px!important}

.chat_line:nth-child(even),PRE{background-color:rgba(255,255,255,0)!important;
color:rgba(62,2,99,1)!important}


.answer_container,
.notes LI{background:rgba(239,214,255,.8)!important;
}



.post_question {
 
  background-color: rgba(177,76,245,1) !important;

}

.post_question_nipple {

  background: none !important;

  width: 0px !important;

  height: 0px !important;

  margin-top: 0px !important;

  border-top: solid 8px rgba(177,76,245,1) !important;

  border-right: 8px solid rgba(255,255,255,0) !important; 

  border-left: 8px solid rgba(255,255,255,0) !important; 

}

.post_question {
 
  color: rgba(255,255,255,.9) !important;

}


#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {

  
background: rgba(255,255,255, 0.0) !important;

}
 


.selection_nipple.white, .selection_nipple:not([class="selection_nipple white"]) {

  background: none !important;

  width: 0px !important;

  height: 0px !important;

  margin-top: 0px !important;

  border-bottom: solid 11px rgba(62,149,249,0.0) !important;

  border-right: 11px solid transparent !important;

  border-left: 11px solid transparent !important;

}



.selection_nipple:not([class="selection_nipple white"]) {

  border-bottom: solid 11px rgba(178,91,245,1)  !important;

}







li.selected, li.recessed, a.active, div.post_filter_tabs a {

  background: none !important;

}







.post.photo_post .photo, .post.photo_post .video_thumbnail {

 box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.0) !important;

